<script lang="ts">
  import { onMount } from 'svelte';
	const initProgress = async () => {
		try {
			const waveSurfer = (await import('wavesurfer.js')).default;
			const audio = waveSurfer.create({
				container: `#waveform`,
				// waveColor: '#000000',
				// progressColor: '#ffffff'
			});
			audio.load("data:audio/mpeg;base64,");
		} catch (error) {
			console.error(error);
		}
	};

	onMount(() => {
		initProgress();
	});
</script>

<div id="waveform" />
